 murderers, rapists and robbers have their own rules of survival.\n\nThe series accompanies guards on their daily routines: those who struggle to maintain law and order and those who abuse their powers mercilessly.  But above all, each episode allows the viewer to see the world from the prisoners point of view: the newcomer spending his first terrifying night locked up. Felons who live for the day when their fate will be decided: will it be life behind bars? A worse fate? Foreigners, far away from home, languishing away under the most horrendous conditions. And mothers who have to raise their children in the shadow of prison bars. \n\nSubscribe Free Documentary Channel for free: "},{"text":"https://bit.ly/2YJ4XzQ","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIw7CCk8KY6gIV9CrxBR2W-A0gSMjfrt2jsO-CiAE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fbit.ly%2F2YJ4XzQ\u0026event=video_description\u0026redir_token=wXnHUZsz2CgjpgL7j7mdH1kh52R8MTU5MzAyMTYyN0AxNTkyOTM1MjI3\u0026v=iAW9gjurr8g","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fbit.ly%2F2YJ4XzQ\u0026event=video_description\u0026redir_token=wXnHUZsz2CgjpgL7j7mdH1kh52R8MTU5MzAyMTYyN0AxNTkyOTM1MjI3\u0026v=iAW9gjurr8g","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nJoin the club and become a Free Documentary Patron: "},{"text":"https://www.patreon.com/freedocumentary","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIw7CCk8KY6gIV9CrxBR2W-A0gSMjfrt2jsO-CiAE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.patreon.com%2Ffreedocumentary\u0026event=video_description\u0026redir_token=wXnHUZsz2CgjpgL7j7mdH1kh52R8MTU5MzAyMTYyN0AxNTkyOTM1MjI3\u0026v=iAW9gjurr8g","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.patreon.com%2Ffreedocumentary\u0026event=video_description\u0026redir_token=wXnHUZsz2CgjpgL7j7mdH1kh52R8MTU5MzAyMTYyN0AxNTkyOTM1MjI3\u0026v=iAW9gjurr8g","target":"TARGET_NEW_WINDOW","nofo
